import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // To reveal the view mode buttons, we must first perform a search.
    await page.locator('#searchInput').fill('electronics');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // Click the search button. There are two, we'll click the first one.
    await page.locator('button.search-btn').first().click();

    // Wait for the search results and view toggle buttons to appear
    await page.waitForSelector('button[title="List View"]', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_grid_view_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_grid_view_results.png'));

    // Locate and click the "List View" button
    const listViewButton = page.getByTitle('List View');
    await listViewButton.click();

    // Wait for the product container to switch to list view mode
    await page.waitForSelector('.products-list', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_list_view_activated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_list_view_activated.png'));

    // Extract data to verify the switch
    const isButtonActive = await listViewButton.evaluate(node => node.classList.contains('active'));
    const productContainer = await page.locator('.products-list');
    const containerClass = await productContainer.getAttribute('class');

    return {
      success: true,
      action: "Switched product view from grid to list mode.",
      extractedData: {
        isListViewButtonActive: isButtonActive,
        productContainerClass: containerClass
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // On failure, capture a final screenshot if possible
    try {
      const errorScreenshotPath = path.join(screenshotsDir, 'error_screenshot.png');
      await page.screenshot({ path: errorScreenshotPath });
      screenshots.push(errorScreenshotPath);
    } catch (e) {
      // Ignore if screenshot fails
    }

    return {
      success: false,
      action: "Failed to switch to list view mode",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
